import React from "react";
import { Box, TextField, Button } from "@mui/material";

function Signup() {
  function handleSubmit() {
    console.log("Submitted");
  }
  return (
    <div>
      <form onSubmit={handleSubmit}>
        <Box>
          <TextField />
          <TextField />
          <TextField />
          <Button type="submit">Signup</Button>
        </Box>
      </form>
    </div>
  );
}

export default Signup;
